import React from 'react';
import './App.css';
import Heroes from './assets/components/heroes';

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Heroes name="Бэтмен" universe="DC Comics" alterego="Брюс Уэйн" occupation="борец с преступностью, филантроп, миллиардер" friends="Робин, Бэтгерл" superpowers="интеллект, обширные познания, знания боевых искусств, ловкость" info/>
        <Heroes name="Супермен" universe="DC Comics"/>
        <Heroes name="Железный человек" universe/>
        <Heroes name="Спайдер-мен/Человек-паук" universe/>
        <Heroes name="Капитан Америка" universe/>
        <Heroes name="Тор" universe/>
        <Heroes name="Халк" universe/>
        <Heroes name="Чудо-женщина" universe/>
        <Heroes name="Черная вдова" universe/>
        <Heroes name="Дэдпул" universe/>
      </div>
    );
  }
}

export default App;
